import './App.css';
import {
  createBrowserRouter,
RouterProvider
} from "react-router-dom"
import Product from './Product/Product';
import Home from './Home/Home';
function App() {
  const router=createBrowserRouter([
    {
      path:"/",
      element:<Home/>
    },
    {
      path:"/product/:id",
      element:<Product/>
    },
    {
      path:"/products/:id",
      element:<Products/>
    }


  ])
  return (
    <div >
  <RouterProvider router={router}/>
    </div>
  );
}

export default App;
